  !> Rewrite the scary block of reference C6 coefficients.
  !>
  !> Important: Have at least *one* working version of this reference file around
  !> or you loose access to the self-rewriting feature.
  subroutine writeSelf(unit)
    integer, intent(in) :: unit
    integer :: ipair, ioffset, icn

    call initD3References

    do ipair = 1, maxElem*(1+maxElem)/2, blockSize
      write(unit, '(2x,"c6ab(:, :, ",i0,":",i0,") = reshape([ &")') &
        &  ipair, ipair+blockSize-1
      do ioffset = 0, blockSize-1
        do icn = 1, maxRef
          if (icn.eq.maxRef .and. ioffset.eq.blockSize-1) then
            write(unit, '(4x,"&",4(f10.4,"_dp,"),f10.4,"_dp],&")') &
              &  referenceC6(:, icn, ipair+ioffset)
            write(unit, '(4x,"&",4x,"[maxRef, maxRef, blockSize])",/)')
          else
            write(unit, '(4x,"&",5(f10.4,"_dp,"),1x,"&")') &
              &  referenceC6(:, icn, ipair+ioffset)
          end if
        end do
      end do
    end do

  end subroutine writeSelf


